H20年5月末新発売された新型車フリードのオーディオレス車対象の取付キットです。電源コネクターは新形状24Pコネクター。24Pコネクターには車速信号取出し線もあり、１Ｄ＋１Ｄ～２ＤＩＮサイズのオーディオ、ナビゲーションなどの本体取付が可能です。 <br><br>■構成部品 ■パネル ■スポンジテープ ■サイドブラケット(L) ■サイドブラケット(R) ■車種専用ブラケット(L) ■車種専用ブラケット(R) ■コネクター(24P) ■アンテナ変換コネクター ■トラスタッピングねじx8 ■バインドねじx8 ■タッピングねじx4 ■バネ・平座金付ねじx2 ■ほかに取付説明書を同梱<br><br> <br><br>フリード オーディオレス車 <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
